@DocProfSky parolas proksimume “Kial mi AMAS Mian 3D Printilon” Ĉe Ekbruligi Phoenix 9. Antaŭ amaso de ~850 Ekbruligas fervorulojn de la Phoenix metropola areo DocProfSky dividas lian entuziasmon de 3D preso kaj paroladoj pri la MakerBot Cupcake CNC printilo. La amaso donas lin staranta ovacio, unua iam ajn ĉe Ekbruligi Phoenix. Noto: Pli alta superkvalita video de la Ekbruligi Phoenix videa teamo estas venanta baldaŭ al la IgnitePhoenix kanalo (Www.youtube.com Videa Takso: 4 / 5 Akiri konsileto
